import React from 'react';
import './App.css';
import axios from "axios"
import LoginPage from "./pages/login"

class App extends React.Component {
  componentDidMount(){
    axios({
      method:"get",
      url:"/api/public/clients"
    }).then((response)=>{
      console.log(response);
    }).catch(error=>{
      console.log(error);
    })
  }
  render(){
    return (
      <div className="App">
        <LoginPage />
      </div>
    );
  }
}

export default App;
